import { Ewaste, Glass, Plastic, Organic } from '../../assets'

export const dummyLigas = [
    {
        id: 1,
        nama: "La Liga",
        gambar: Organic,
    },
    {
        id: 2,
        nama: "Premier League",
        gambar: Glass,
    },
    {
        id: 3,
        nama: "Bundes Liga",
        gambar: Ewaste,
    },
    {
        id: 4,
        nama: "Serie A",
        gambar: Plastic,
    },
]
